import React, {Component} from 'react'
import logoimg from '../img/logo.svg'
import 'bootstrap/dist/css/bootstrap.min.css'

class Logo extends Component {
    render() {
        return (
            <div>
                <a href="#" style={logoStyle} className="btn bth-danger" role="button">Powered by: <img src={logoimg} alt='Visit Creator`s site' placeholder='jhjllk'/></a>
            </div>
        )
    }
}
const logoStyle = {
    textDecoration: 'none',
    fontWeight: '900'
}
export default Logo
